import React from 'react';
import './about.css'


const About = () => {
    return (
        <div>
            I-Cafe Sukur’s place was opened in 2006 by Sukur Aslan.   Then in 2013,  it expanded to next door, and added Pide ve Lahmacun business.   In 2016, we remodeled our restaurant and became a full service restaurant I-Cafe Sukur’s Place / Pide ve Lahmacun.   Conveniently located just next to the Brown line Irving Park station in City of Chicago,we offer fresh Turkish foods such as Doner kebab, Pide, Lahmacun and Authentic Turkish Tea.

            I-Cafe Sukur’s Place / Pide ve Lahmacun keeps casual atmosphere but still have an offering of assorted fresh foods that are prepared with quality halal ingredients.   “Simple but delicious” as our motto, we serve delicious food with reasonable prices and friendly services.    I-Cafe Sukur’s Place / Pide ve Lahmacun opens daily at 10:00am,  closes at 12:00am on Sunday and weekdays, and at 2 am on Fridays and Saturday.   We are closed on Tuesday.  Please visit our online ordering for Carry-out service as well as delivery services.  Call us for your order at 773.755.4022.
        </div>
    );
};

export default About;
